import React, {Component} from 'react';
import {CartContext} from './cartContext';

class Cart extends Component {
  render () {
    return (
      <CartContext.Consumer>
        {cart => (
          <div id="cart">
            {cart} Items - Component Cart
          </div>
        )}

      </CartContext.Consumer>
    );
  }
}

export default Cart;
